import './Expense.css'
import ExpenseItem from './ExpenseItem'
const Expense = ({title,amount,date}) => {

    return (
        <div>
            <ExpenseItem title={title[0]} amount={amount[0]} date={date[0]} />
            <ExpenseItem title={title[1]} amount={amount[1]} date={date[1]} />
        </div>
    )


}

export default Expense
